import React from 'react'
import s from './Friend.module.css';
import { NavLink } from 'react-router-dom';

const Friend = (props) => {
  return (
    <div className={s.fr}>
        <img src='https://peopletalk.ru/wp-content/uploads/2016/11/1480331127.jpg'></img>
        {props.name}
    </div>
  )
}


export default Friend
